const galleryImages = [
  {
    title: 'Dead cat Celebration\bWARNING: VERY SAD',
    src: process.env.PUBLIC_URL + '/assets/pictures/campus_celebration.jpg',
  },
  {
    title: 'Graduation Day',
    src: process.env.PUBLIC_URL + '/assets/pictures/graduation_day.jpg',
  },
  {
    title: 'Student Workshop',
    src: process.env.PUBLIC_URL + '/assets/pictures/workshop.jpg',
  }
  // You can add more as needed
];

export default galleryImages;
